                        <td>LastName</td>
                        <td>Gender</td>
                        <td>Salary</td>
                        <td>Edit</td>
                        <td>Delete</td>
                    </th>
                    <tr>
                        <td>id</td>
                        <td>UserName</td>
                        <td>FirstName</td>
                        <td>LastName</td>
                        <td>Gender</td>
                        <td>Salary</td>
                        <td>Edit</td>
                        <td>Delete</td>
                    </tr>
                </table>
            </div>
        )
    }
}
export default UserList;
